[2018-04-19 17:58:32] ["INSERT INTO `frame_articles` (`pid`, `title`, `content`, `create_time`) VALUES ('10', 'wxpy\u5fae\u4fe1\u804a\u5929\u673a\u5668\u4eba', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); font-family: arial, helvetica, sans-serif; font-size: 16px;&quot;&gt;\u4e00\u3001\u5b9e\u9a8c\u73af\u5883\uff1awin10 + python3 + wxpy \u5fae\u4fe1\u7248\u672c\uff1a6.6.5&lt;\/span&gt;&lt;\/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;1.1\u3001\u4ece\u5b98\u7f51\u4e0b\u8f7dpython\u6700\u65b0\u7248\u672c\u5e76\u8fdb\u884c\u5b89\u88c5\u3002&lt;\/span&gt;&lt;\/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;1.2\u3001\u8fdb\u5165python\u5b89\u88c5\u76ee\u5f55Scripts\/\u6587\u4ef6\u5939\u4e0b\uff0c\u4f7f\u7528easy_install.exe pip \u547d\u4ee4\u5b89\u88c5pip&lt;\/span&gt;&lt;\/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;1.3\u3001\u4f7f\u7528pip install wxpy \u547d\u4ee4\u5b89\u88c5wxpy&lt;\/span&gt;&lt;\/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br\/&gt;&lt;\/span&gt;&lt;\/p&gt;&lt;p&gt;\u4e8c\u3001\u6e90\u4ee3\u7801\u3002demo.py&lt;br\/&gt;&lt;\/p&gt;&lt;pre class=&quot;brush:python;toolbar:false&quot;&gt;#coding=utf-8\\r\\nfrom&amp;nbsp;wxpy&amp;nbsp;import&amp;nbsp;*\\r\\nbase_bot&amp;nbsp;=&amp;nbsp;Bot(True)\\r\\n#&amp;nbsp;\u67e5\u627e\u6307\u5b9a\u7fa4\u804a\u7fa4\u804a&amp;nbsp;\uff0c&amp;nbsp;\u786e\u4fdd\u626b\u7801\u5fae\u4fe1\u4e2d\u6709&amp;nbsp;\u201c123\u201d&amp;nbsp;\u8fd9\u4e2a\u7fa4\\r\\ngroup&amp;nbsp;=&amp;nbsp;base_bot.groups().search(&amp;#39;123&amp;#39;)\\r\\n#&amp;nbsp;\u81ea\u52a8\u63a5\u53d7\u65b0\u7684\u597d\u53cb\u8bf7\u6c42\\r\\n@base_bot.register(msg_types=FRIENDS)\\r\\ndef&amp;nbsp;auto_accept_friends(msg):\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;if&amp;nbsp;&amp;#39;\u52a0\u597d\u53cb&amp;#39;&amp;nbsp;in&amp;nbsp;msg.text.lower():\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;#&amp;nbsp;\u63a5\u53d7\u597d\u53cb\u8bf7\u6c42\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;new_friend&amp;nbsp;=&amp;nbsp;base_bot.accept_friend(msg.card)\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;#&amp;nbsp;new_friend&amp;nbsp;=&amp;nbsp;msg.card.accept()\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;#&amp;nbsp;\u5411\u65b0\u7684\u597d\u53cb\u53d1\u9001\u6d88\u606f\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;new_friend.send(&amp;#39;\u4f60\u597d\uff0c\u6211\u662f\u7fa4\u804a\u673a\u5668\u4eba\uff0c\u56de\u590d&amp;quot;\u5165\u7fa4&amp;quot;\u53e3\u4ee4\u8fdb\u5165\u7fa4\u804a\u5929\u54e6\uff01&amp;#39;)\\r\\n#&amp;nbsp;\u63a5\u6536\u6587\u5b57\u6d88\u606f\u7684\u88c5\u9970\u5668\\r\\n@base_bot.register(msg_types=TEXT)\\r\\ndef&amp;nbsp;add_into_chatroom(msg):\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;#&amp;nbsp;\u63a5\u6536\u8fdb\u7fa4\u53e3\u4ee4\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;if&amp;nbsp;msg.text.lower()&amp;nbsp;==&amp;nbsp;&amp;#39;\u5165\u7fa4&amp;#39;:\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;#&amp;nbsp;use_invitation\u4e3aTrue\uff0c\u53d1\u9001\u7fa4\u9080\u8bf7\uff0cFalse\u5219\u62c9\u8fdb\u7fa4\u804a\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;group[0].add_members(msg.sender,&amp;nbsp;use_invitation=True)\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;else:\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;#&amp;nbsp;\u5176\u4ed6\u6d88\u606f\\r\\n&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;return&amp;nbsp;u&amp;#39;\u6536\u5230\uff1a&amp;#39;&amp;nbsp;+&amp;nbsp;msg.text\\r\\nbase_bot.join()&lt;\/pre&gt;&lt;p&gt;\u4e09\u3001\u6548\u679c\u5c55\u793a&lt;\/p&gt;&lt;p&gt;&lt;img src=&quot;https:\/\/segmentfault.com\/img\/bV7ucv?w=10